import React, { useState } from 'react';
import { Grid, User, FileText } from 'lucide-react';
import { profileData, projects, aboutMe } from './data';

const InstagramProfile = () => {
  const [activeTab, setActiveTab] = useState('projects');

  const tabs = [
    { name: 'PROJECTS', icon: Grid, value: 'projects' },
    { name: 'ABOUT ME', icon: User, value: 'about' },
    { name: 'BLOG', icon: FileText, value: 'blog' },
  ];

  const handleTabChange = (tabValue) => {
    console.log('Changing tab to:', tabValue);
    setActiveTab(tabValue);
  };

  const renderAboutGrid = () => {
    console.log('Rendering About Grid');
    return (
      <>
        {aboutMe.map((item, index) => (
          <div 
            key={index}
            className={`aspect-square bg-gray-100 p-6 rounded-xl shadow-lg flex flex-col items-center justify-center`}
          >
            <h3 className="font-bold text-xl text-center font-serif">{item.title}</h3>
            <p className="text-sm text-center mt-2">{item.content}</p>
          </div>
        ))}
      </>
    );
  };

  const renderContent = () => {
    console.log('Rendering content for tab:', activeTab);
    try {
      switch(activeTab) {
        case 'projects':
          return <div>Projects will be displayed here</div>;
        case 'about':
          return renderAboutGrid();
        case 'blog':
          return <div>Blog posts will be displayed here</div>;
        default:
          return null;
      }
    } catch (error) {
      console.error('Error rendering content:', error);
      return <div>Error rendering content</div>;
    }
  };

  return (
    <div className="max-w-3xl mx-auto p-4">
      <h1>{profileData.username}</h1>
      
      <nav className="border-t border-gray-300 mb-8">
        <ul className="flex justify-center space-x-12 -mt-px">
          {tabs.map((tab) => (
            <li key={tab.value} className="pt-3">
              <button 
                onClick={() => handleTabChange(tab.value)}
                className={`flex items-center ${activeTab === tab.value ? 'text-black' : 'text-gray-500'}`}
              >
                {React.createElement(tab.icon, { size: 12, className: "mr-1" })}
                {tab.name}
              </button>
            </li>
          ))}
        </ul>
      </nav>

      <div className="grid grid-cols-2 gap-4">
        {renderContent()}
      </div>
    </div>
  );
};

export default InstagramProfile;
